import React from 'react'
import { View, Text } from 'react-native'
import TripUpdateModal from './TripUpdateModal'

const CardUpdate = ({trip}) => {
    return (
        <View>
                <TripUpdateModal oldTrip={trip} />
        </View>
    )
}

export default CardUpdate
